import React from "react";
import styled from "styled-components";

const Title = () => {
    return (
        <Wrapper>
          <h2>마이페이지</h2>
        </Wrapper>
    );
};

export default Title;

const Wrapper = styled.div`
margin-top: 27px;
font-size: 5rem;
`
